import React from "react";


const regions = [
  { lable: "RU", value: 1 },
  { lable: "TR", value: 2 },
  { lable: "BR", value: 3 },
  { lable: "OCE", value: 4 },
  { lable: "LAS", value: 5 },
  { lable: "EUNE", value: 6 },
  { lable: "EUW", value: 7 },
  { lable: "NA", value: 8 },
  { lable: "KR", value: 9 },
  { lable: "LAN", value: 10 },
];

const DropDown = () => {
  return (
    <select>
      <option value="grapefruit">Grapefruit</option>
      <option value="lime">Lime</option>
      <option selected value="coconut">
        Coconut
      </option>
      <option value="mango">Mango</option>
    </select>
  );
};

export default DropDown;
